  false,\n\t\"url\": null,\n\t\"notes\": \"Population sizes of many, but not all,
  amphibian species have experienced declines on all six continents on which they
  occur (Phillips 1990, Vial and Saylor 1993). Many amphibian populations became extinct
  in the Rocky Mountains of Colorado during the mid-1970s. The Boreal toad (Bufo boreas
  boreas) and the northern leopard frog (Rana pipiens) were among the disappearing
  species. A wide variety of metals and other contaminants are known to be immunosuppressive
  and are known to affect soil and water microorganism populations (Sharma and Reddy,
  1987; van Elsas et al. 1992).  The questions addressed by this study are: 1) what
  levels of metals and organochlorines exist in sediment and amphibian tissues in
  breeding areas of montane amphibians in Colorado, and 2) what is the effect of metal
  exposure on immune function in leopard frogs?\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
